import { Component, OnInit, Input } from '@angular/core'
import { IBadgeRecent } from '../../../badges/badges.model'
import { jsPDF } from 'jspdf'
import 'jspdf-autotable'
import { IUserProfileDetailsFromRegistry } from '../../../../../user-profile/models/user-profile.model'
import * as moment from 'moment'
import { BadgesService } from '../../badges.service'

@Component({
  selector: 'ws-app-badges-card',
  templateUrl: './badges-card.component.html',
  styleUrls: ['./badges-card.component.scss'],
})
export class BadgesCardComponent implements OnInit {
  @Input()
  badge!: IBadgeRecent

  @Input() badgeRecent = []
  @Input() userName!: string
  imageUrl = '/fusion-assets/icons/certificate.jpg'
  allowDownload = false
  myMoment: moment.Moment = moment('2020-01-11')
  @Input() userProfileData!: IUserProfileDetailsFromRegistry

  constructor(private badgesSvc: BadgesService) { }
  ngOnInit() {
    if (this.badge && this.badge.last_received_date) {
      this.allowDownload = moment(this.badge.last_received_date).isSameOrAfter('2021-03-08')
    }
  }
  getBase64Image(img: any) {
    const canvas = document.createElement('canvas')
    const ctx = canvas.getContext('2d')
    if (img) {
      canvas.width = img.width
      canvas.height = img.height
      if (ctx) {
        ctx.drawImage(img, 0, 0)
      }
    }
    const dataURL = canvas.toDataURL('image/jpeg')
    return dataURL
  }

  downloadPdf(badgeId: string) {

    let imageData = ''
    // Fernandes course
    if (badgeId === 'lex_auth_01317364426178560033') {
      const doc = new jsPDF('landscape', 'mm', [297, 210])
      const width = doc.internal.pageSize.getWidth()
      const height = doc.internal.pageSize.getHeight()
      imageData = this.getBase64Image(document.getElementById('imageUrl'))
      doc.addImage(imageData, 'JPG', 0, 0, width, height)

      doc.setFontSize(20)
      doc.setTextColor(100);

      (doc as any).autoTable({
        body: [
          [{
            // tslint:disable-next-line:max-line-length
            content: `${this.badge.badge_name} \n by  ${`${this.titleCaseWord(this.userProfileData.personalDetails.firstname)} ${this.userProfileData.personalDetails.surname}`} \n Completed on ${this.badge.first_received_date}`,
            colSpan: 2,
            rowSpan: 2,
            styles: { halign: 'center' },
          }],
        ],
        theme: 'plain',
        columnStyles: { 0: { halign: 'center', font: 'times', fontSize: 24, minCellHeight: 50 } },
        margin: { top: 80 },

      })
      doc.save('certificate_fernandez.pdf')
    } else {

      const req = {
        course: badgeId,
      }

      let responseQRCode = ''
      let dataImage = ''
      this.badgesSvc.generateQRCode(req).subscribe(data => {
        responseQRCode = data.data
        if (data) {
          // tslint:disable-next-line:max-line-length
          dataImage = ''

          const doc = new jsPDF('landscape', 'mm', [297, 190])
          const width = doc.internal.pageSize.getWidth()
          const height = doc.internal.pageSize.getHeight()

          doc.addImage(dataImage, 'JPG', 0, 0, width, height)

          doc.setFontSize(20)
          doc.setTextColor(100);

          (doc as any).autoTable({
            body: [
              [{
                // tslint:disable-next-line:max-line-length
                content: ` ${`${this.titleCaseWord(this.userProfileData.personalDetails.firstname)} ${this.userProfileData.personalDetails.surname}`}`,
                colSpan: 2,
                rowSpan: 2,
                styles: { halign: 'center' },
              }],
            ],
            theme: 'plain',
            columnStyles: { 0: { halign: 'center', font: 'times', fontSize: 24, minCellHeight: 50 } },
            margin: { top: 88 },

          })
          doc.addImage(responseQRCode, 'png', 5, 140, 40, 40)
          doc.save('certificate_pocqi.pdf')
        }
      })
    }
  }

  titleCaseWord(word: string) {
    if (!word) { return word }
    return word[0].toUpperCase() + word.substr(1).toLowerCase()
  }
}
